import React from 'react';
import Img from '../../images/movie.jpg';
import { MovieImg,
         MovieContainer,
         MovieWrapper,
         DetWrapper,
         MovieName 
        
        } from './movieelements';

function movie() {
    return (


        <div>

         <InfoContainer lightBg = {lightBg} id={id}>
            <InfoWrapper>
                <InfoRow data-aos="fade-up" imgStart={imgStart}>
                    <Column1>
                      <TextWrapper>
                          <TopLine>
                              {topLine}
                          </TopLine>

                          <Heading lightText={lightText}>
                              {headline}
                          </Heading>

                          <Subtitle darkText={darkText}>
                              {description}
                          </Subtitle>

                          <BtnWrap>
                              <Button to='home'
                             smooth={true} 
                             duration={500} 
                             spy={true} 
                             exact='true' 
                             offset={-80}
                              primary={primary ? 1 : 0}
                              dark={dark ? 1 : 0}
                              dark2={dark2 ? 1: 0}

                              >{buttonLabel}</Button>  
                          </BtnWrap>
                      </TextWrapper>
                    </Column1>

                    <Column2>
                       <ImgWrap>
                       <Img src={img} alt={alt}/>
                       </ImgWrap>
                    </Column2>

                </InfoRow>
            </InfoWrapper>
        </InfoContainer>
           
            
        </div>
    )
}

export default movie
